import React from "react";
import "./AdmissionButton.css";

const AdmissionButton = () => {
  return (
    <div className="admission-btn-wrapper">
      <a href="/admissions" className="admission-btn">
        Admissions Open!
      </a>
    </div>
  );
};

export default AdmissionButton;
